import React, { useState, useEffect } from 'react'

export default function UsersData() {
  const [Movie, fetchMovies] = useState([])

  const getData = () => {
    fetch('http://localhost:8081/api/getall')
      .then((res) => res.json())
      .then((res) => {
        console.log(res)
        fetchMovies(res)
      })
  }

  useEffect(() => {
    getData()
  }, [])

  return (
    <>
      <h2>React Fetch API Example</h2>
      <ul>
        {Movie.map((item, i) => {
          return <li key={i}>{item.name}</li>
        })}
      </ul>
    </>
  )
}
